import Employes from "./Components/Employes";
import Detalis from "./Components/Details.json";
import { useState } from "react";

function App() {
  const [details, setDetails] = useState(Detalis.Details);
  return (
    <div className="w-8/12 py-10 p-1 h-screen bg-gray-100 mx-auto flex gap-10 justify-between  flex-wrap">
      <>
        {details.map((details) => (
          <Employes name={details.name} role={details.role} img={details.img} />
        ))}
      </>
    </div>
  );
}

export default App;
